  {% else %}
    select a.*

      {% if var('snowplow__enable_web') %}
      , a.engaged_time_in_s_web as engaged_time_in_s
      {% endif %}

    from session_aggs a
  {% endif %}
)

{%- if var('snowplow__enable_mobile_context') %}

